def get_random_ua(ua_type):
    if ua_type == 0:
        return random.choice(ios_ua_list)
    elif ua_type == 1:
        version = random.choice(web_google_ua_version_list)
        ua = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/" + version + " Safari/537.36"
        return ua
    elif ua_type == 2:
        return random.choice(android_ua_list)
    else:
        return random.choice(web_ua_list)
